// src/index.tsx
import React from 'react';
import ReactDOM from 'react-dom';
import FarmList from './components/FarmList';

const App: React.FC = () => {
  return (
    <div className="App">
      <h1>Pig Movement Tracker</h1>
      <FarmList />
      {/* Add your components and routes here */}
    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
